import React from "react";

import Products from "../../components/products/products";
import SelectList from "../../components/layout/select/select";

import {
  Filter,
  FilterContainer,
  FilterText,
  Title
} from './styled';

const ProductsPage = () => {

  const colors = [
    'White',
    'Black',
    'Red',
    'Blue',
    'Yellow',
    'Green'
  ]

  const size = [
    'XS',
    'S',
    'M',
    'L',
    'XL',
    'XXL'
  ]

  return (
    <div className="container">
      <Title>Dresses</Title>
      <FilterContainer>
        <Filter>
          <FilterText>Filter Products:</FilterText>

          <SelectList 
            title={ 'Color' }
            data={ colors }
          />

          <SelectList 
            title={ 'Size' }
            data={ size }
          />

        </Filter>
        <Filter>
          <FilterText>Sort Products:</FilterText>

          <SelectList 
            title={ 'Size' }
            data={ ['Newest', 'Price (asc)', 'Price (desc)'] }
          />

        </Filter>
      </FilterContainer>
      <Products />
    </div>
  );
};

export default ProductsPage;
